import React from 'react';
import './App.css';
import Card from 'react-bootstrap/Card';
import CardDeck from 'react-bootstrap/CardDeck';
import 'bootstrap/dist/css/bootstrap.min.css';
import game2048 from './Img/game2048.png';
import gamePuzzle15 from './Img/gamePuzzle15.png';
import gameReversi from './Img/gameReversi.png';


function App() {
    return (
    	<div>
			<CardDeck>
  				<Card>
    				<Card.Img src={game2048} width='400' height="200"/>
    				<Card.Body>
      					<Card.Title><h1>2048</h1></Card.Title>
    				</Card.Body>
  				</Card>
				<Card>
    				<Card.Img  src={gamePuzzle15} width='400' height="200"/>
    				<Card.Body>
      					<Card.Title>Card title</Card.Title>
    				</Card.Body>
  				</Card>
				<Card>
    				<Card.Img variant="top" src={gameReversi} width='400' height="200"/>
    				<Card.Body>
      					<Card.Title>Card title</Card.Title>
    				</Card.Body>
  				</Card> 
				<Card>
    				<Card.Img variant="top" src={game2048} />
    				<Card.Body>
      					<Card.Title>Card title</Card.Title>
    				</Card.Body>
  				</Card> 

			</CardDeck>
    	</div>
  	);
}
export default App;
